import React, { Component } from "react";
import Table from "../components/table/index";
import { Redirect } from "react-router-dom";

export default class Test extends Component {
    constructor(props) {
        super(props);
        this.state = {
            // testArrayState: [],
            columnHearder: ["Id", "First Name", "Last Name"],
            rowData: [],
            redirectURL: "/test",
            currentPoID: "",
            exceptionStatus: 0
        }
    }

    componentWillMount() {
        let testArray = [];
        fetch("http://localhost:3001/test_select_all")
            .then(res => {

                console.log(res.status);
                if (res.status == 200) { return res.json(); }
                throw `Invalid Query`
            })
            .then(dbres => {
                testArray = dbres.map(item => {
                    return {
                        testId: item.test_id,
                        firstName: item.first_name,
                        secondName: item.second_name
                    };
                });
                console.log("test array " + JSON.stringify(testArray, null, 4));

            });
        this.setState({
            //testArrayState: testArray,
            rowData: testArray
        }).catch(err => {
            alert(err);
        })

    }
    render() {
        return (
            <div className="test">
                {console.log("on test page ")}
                <p>Test page </p>
                <p>{this.state.testArrayState}</p>
                {console.log("rowData" + this.state.rowData)}
                <Table {...this.state} navigateRow={this.redirect.bind(this)} />
                {/* <p>{new Table(this.state.testArrayState)}</p> */}
            </div>
        )
    }
    redirect(testId) {
        this.props.history.push({
            pathname: this.state.redirectURL
        })
    }

}
